--
-- Funciones
--
CREATE DEFINER=`root`@`localhost` FUNCTION `transferir_puntos` (`id_tarjeta_var` VARCHAR(7)) RETURNS INT(11)  BEGIN
    DECLARE puntos_tarjeta_var INT;
    DECLARE id_usuario_var INT;
    DECLARE puntos_usuario_var INT;

    -- Obtiene los puntos de la tarjeta y el ID del usuario
    SELECT puntos_tarjetas, propietario_tarjetas 
    INTO puntos_tarjeta_var, id_usuario_var FROM tarjetas WHERE id_tarjetas = id_tarjeta_var;

    -- Obtiene los puntos actuales del usuario
    SELECT puntos_usuarios INTO puntos_usuario_var FROM usuarios WHERE id_usuarios = id_usuario_var;

    -- Verifica si se encontró la tarjeta y el usuario
    IF puntos_tarjeta_var IS NULL OR id_usuario_var IS NULL THEN
        RETURN 0; -- Código de error
    END IF;

    -- Actualiza los puntos de la tarjeta y los del usuario
    UPDATE tarjetas SET puntos_tarjetas = 0 WHERE id_tarjetas = id_tarjeta_var;
    UPDATE usuarios SET puntos_usuarios = puntos_usuario_var + puntos_tarjeta_var WHERE id_usuarios = id_usuario_var;

    RETURN 1; -- Código de éxito
END$$

