DELIMITER $$
CREATE TRIGGER `RestarPremios` BEFORE INSERT ON `premios_usuarios` FOR EACH ROW BEGIN
    DECLARE premio_count INT;
    SELECT cantidad_premios INTO premio_count FROM premios WHERE id_premios = NEW.id_premios;
    
    IF premio_count > 0 THEN
        UPDATE premios SET cantidad_premios = premio_count - 1 WHERE id_premios = NEW.id_premios;
    END IF;
    
    IF premio_count - 1 = 0 THEN
        UPDATE premios SET estado_premios = 'desactivado' WHERE id_premios = NEW.id_premios;
    END IF;
END
$$
DELIMITER ;
