    SELECT costo_premios INTO costo_premios_var FROM premios WHERE id_premios = NEW.id_premios;

    -- Actualizar saldo_tarjetas en la tabla tarjetas
    UPDATE usuarios
    SET puntos_usuarios = puntos_usuarios - costo_premios_var
    WHERE id_usuarios = NEW.id_usuarios; 
END
$$
