DELIMITER $$
CREATE TRIGGER `InsertarVenta_Tarjeta` AFTER INSERT ON `tarjetas` FOR EACH ROW BEGIN
DECLARE id_usuarios_var INT;
-- Obtener el tipo de la tarjeta basado en el insertado en la tabla tarjetas
DECLARE tipo_tarjetas_var VARCHAR(50);
-- Creando un precio según el tipo de la tarjeta
DECLARE precio_tarjetas_var float;

SELECT id_usuarios INTO id_usuarios_var FROM usuarios WHERE id_usuarios = NEW.propietario_tarjetas;

-- Obtener el tipo de tarjeta de la tabla tarjetas
    SELECT tipo_tarjetas INTO tipo_tarjetas_var FROM tarjetas WHERE id_tarjetas = NEW.id_tarjetas;

    -- Determinar el precio basado en el tipo de tarjeta
    IF tipo_tarjetas_var = 'Gold' THEN
        SET precio_tarjetas_var = 300.0; -- Precio para Tipo1
    ELSEIF tipo_tarjetas_var = 'Silver' THEN
        SET precio_tarjetas_var = 150.0; -- Precio para Tipo2
    ELSE
        SET precio_tarjetas_var = 0.0; -- Precio predeterminado para otros tipos
    END IF;

    -- Insertar la transacción con el precio determinado
    INSERT INTO transacciones (tipo_transacciones, costo_transacciones, fecha_transacciones, id_usuarios)
    VALUES ('Ven_Tarjeta', precio_tarjetas_var, NOW(), id_usuarios_var);
END
$$
DELIMITER ;

